import React from "react"; 
import {Btn, Container,HeadTitle,Titlecontainer,Topcontainer,Inputtype} from './style'

class Buttons extends React.Component{
      render(){
        return(
            <Container>
                <Titlecontainer>
                  <Topcontainer>

              <HeadTitle>Login</HeadTitle>
              <HeadTitle color="#46a358">Register</HeadTitle>
              <HeadTitle>Enter your username and password to login.</HeadTitle>
               <Inputtype></Inputtype>
               <Inputtype></Inputtype>

               <Btn>Login</Btn>

                </Topcontainer> 
              </Titlecontainer>
            </Container>
        )
      }
}
export default Buttons
